import React from "react";

const Charaters = props => {
  let titleCard = document.querySelector("h5");
  return (
    <div className="blocName d-flex flex-column text-dark ">
      {props.data.map(user => (
        <div className="card" style={{ width: "18rem" }}>
          <img src={props.img} className="card-img-top" alt="..." />
          <div className="card-body" key={user.char_id}>
            <h5 id={user.name}>{user.name}</h5>
            <p className="card-text">Birthday: {user.birthday}</p>
            <p className="card-text">Birthday: {user.occupation}</p>
            <p className="bg-success text-light-center py-3">{user.status}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Charaters;
